import React, {useEffect, useState} from "react";
import {useParams} from "react-router-dom";

import {apiGet} from "../utils/api";



const Sales = () => {
    const {identificationNumber} = useParams();
    const [sale, setSale] = useState({});
   

    useEffect(() => {
        
        apiGet("/api/identification/" + identificationNumber + "/sales").then((data) => setSale(data));
    }, []);

  

    
    
    return (
       
        
            <div>
                
                <h1>Detail osoby</h1>
                <hr/>
                <p>{sale.person.name}</p>
                <p>{sale.taxNumber}</p>
                <p>{sale.identificationNumber}</p>
                <p>{self.invoiceNumber}</p>
                <table className="table table-bordered">
                    <thead class="table-light">
                    <tr>
                        <th>#</th>
                        <th>Jméno</th>
                        <th colSpan={3}>příjem z prodeje</th>
                    </tr>
                    </thead>
                    <tbody class="table-group-divider">
                        {sale.map((seznam, index) => (
                            <tr key={index + 1}>
                                <td>{index + 1}</td>
                                <td>{seznam.name}</td>
                                <td>{seznam.taxNumber} Kč</td>
                            </tr>
                            ))}
                    </tbody>
                </table>
                
             
            </div>          
        
    );
};

export default Sales;
